import React from 'react';


class TableForm extends Component{
  constructor(props){
    super(props);
    this.state={
      date: null,
      time: null,
      partySize:null,
    };
};

render(){
    return(
      <>
        <h2>Available Tables</h2>
        <form>

          <select id="party-size-selector">
            <option
              placeholder="Enter party size"
              value="7">
            </option>
          </select>

          <input
            type = "Date"/>

          <input id="button" type="submit"
          value="Show tables"/>

        </form>
      </>
    );
  };
};
export default TableForm;
